import "./Body.css";
import Card from "./Card/Card";


export default function Body(){
    return(
        <>
            <div className="b">
                 <div className="b-RP">
                     <h1>Romantic Playlist</h1>
                     {/* <Card /> */}
                 </div>
                 <div className="b-SP">
                     <h1>Sad Playlist</h1>
                 </div>
                 <div className="b-userP">
                     <h1>Your's Favorite</h1>
                 </div>
            </div>
        </>
    );
}
